// import logo from './logo.svg';
import './App.css';
import Navbar from './pages/Navbar';
import News from './pages/News';
import Signin from './pages/Signin';

import {
  BrowserRouter as Router,
  Route,
  Routes
} from "react-router-dom";

let style={


}
function App(props) {
  let country='in'
  let pagesize=20 
  let catagery='General'
  return (
    <div>
      <Router>
      <LoadingBar
            height={3}
            color='#f11946'
            progress={this.stateprogress}

          />
        <Navbar/>
        <Routes>
          <Route exact path='/' element={<News key="general" catagery='General'  pageSize={pagesize}  category="general" country={country}/>} />
          <Route exact path='/business' element={<News key="business" catagery='Business'  pageSize={pagesize}  category="business"country={country} />} />
          <Route exact path='/entertainment' element={<News key="entertainment" catagery='Entertainment'  pageSize={pagesize}  category="entertainment" country={country}/>} />
          <Route exact path='/sports' element={<News key="sports" catagery='Sports'  pageSize={pagesize}  category="sports" country={country}/>} />
          <Route exact path='/health' element={<News key="health" catagery='Health'  pageSize={pagesize}  category="health" country={country}/>} />
          <Route exact path='/science' element={<News key="science" catagery='Science'  pageSize={pagesize}  category="science" country={country}/>} />
          <Route exact path='/technology' element={<News key="technology" catagery='Technology' pageSize={pagesize}   category="technology" country={country}/>} />
        </Routes>

      </Router>
    </div>
  );
}

export default App;
